import React from "react";
import logo from "../assets/logo-svg-taurania.svg";
import "./Spinner.css";

function Spinner() {
  return (
    <div className="spinner">
      <img src={logo} alt="logo" className="spinner-logo" />
    </div>
  );
}

export default Spinner;
